import React from 'react'
import BabysitterShow from './BabysitterShow'

const Babysitters = ({babysitters}) => {

    return (
        <div>
            {babysitters.map(baby => 
                
                <ul>
                    <li key={baby.id}>
                    <BabysitterShow />
                        {/* <b>{baby.last_name}, {baby.first_name} </b>
                        <br/>
                        {baby.phone_number} */}
                    </li>

                </ul>
                )}
        </div>
    )


}

export default Babysitters
